"DT_node_lookup" AS 
 (SELECT
    model_input."index" AS "index",
    CASE WHEN (model_input."X_30" <= 0.726508) THEN CASE WHEN (model_input."X_96" <= -0.014965) THEN CASE WHEN (model_input."X_81" <= 0.544003) THEN CASE WHEN (model_input."X_71" <= -1.122099) THEN 19 ELSE CASE WHEN (model_input."X_53" <= -0.164443) THEN 25 ELSE CASE WHEN (model_input."X_10" <= -0.119181) THEN 29 ELSE 30 END END END ELSE CASE WHEN (model_input."X_33" <= -0.412087) THEN 9 ELSE 10 END END ELSE CASE WHEN (model_input."X_55" <= -0.160973) THEN CASE WHEN (model_input."X_68" <= -0.713140) THEN 17 ELSE CASE WHEN (model_input."X_89" <= 0.206539) THEN 21 ELSE 22 END END ELSE CASE WHEN (model_input."X_36" <= -0.017501) THEN CASE WHEN (model_input."X_30" <= -0.305448) THEN 23 ELSE 24 END ELSE CASE WHEN (model_input."X_55" <= 0.345763) THEN 27 ELSE 28 END END END END ELSE CASE WHEN (model_input."X_9" <= -0.911458) THEN 5 ELSE CASE WHEN (model_input."X_74" <= 0.006413) THEN 11 ELSE 12 END END END AS node_id
  FROM model_input
 ),
"DT_node_data" AS 
 (SELECT
    "Values".nid AS nid,
    "Values"."E" AS "E"
  FROM (
    SELECT 0 AS nid, 53.968105 AS "E"
