    UNION ALL
    SELECT 11 AS nid, 410.248016 AS "E"
    UNION ALL
    SELECT 12 AS nid, 309.975525 AS "E"
    UNION ALL
    SELECT 13 AS nid, 123.719421 AS "E"
    UNION ALL
