    UNION ALL
    SELECT 27 AS nid, 6.485013 AS "E"
    UNION ALL
    SELECT 28 AS nid, 2.776306 AS "E"
    UNION ALL
    SELECT 29 AS nid, -54.486095 AS "E"
    UNION ALL
    SELECT 30 AS nid, -55.250984 AS "E"
  ) AS "Values"
 ),
"DT_output" AS 
 (SELECT
   t1."index" AS "index",
   t1.node_id AS node_id,
   t2.nid AS nid,
   t2."E" AS "E"
  FROM
   "DT_node_lookup" AS t1
   LEFT OUTER JOIN
   "DT_node_data" AS t2
   ON t1.node_id = t2.nid
 )
SELECT
   "DT_Output"."index" AS "index",
   "DT_Output"."E" AS "Estimator"
FROM "DT_Output"